import { useState } from "react"

function Listitem() {

    const [todos, setTodos] = useState([
        {
            id: 1,
            text: "Nod JS",
            isCompleted: false
        },
        {
            id: 2,
            text: "Nod JS",
            isCompleted: false
        },
        {
            id: 3,
            text: "Nod JS",
            isCompleted: false
        }

    ])
return(
    <div>
       item = {todos.map((agrr)=>{
            <div>{agrr.text}</div>
        })}
    </div>
)
}
export default Listitem
